Ocean Adventures: Americas Underwater Treasures

Nature Documentary hosted by Robert Redford and Jean Michel Cousteau, published by PBS in 2006 - English narration


Information
------------------------------

Dive into JEAN-MICHEL COUSTEAU: OCEAN ADVENTURES! Join Peabody and Emmy Award-winning Jean-Michel Cousteau and his acclaimed diving team as they explore a thrilling array of natural phenomena, investigate little known territories and ecosystems hundreds of feet beneath the ocean's surface, and come face to face with the friendly and ferocious inhabitants of the deep in each episode of OCEAN ADVENTURES. Through Jean-Michel's observations, the series illuminates the great need for better understanding and sustainable management of the oceans' rich natural treasures.

AMERICA'S UNDERWATER TREASURES PARTS 1 AND 2
Jean-Michel Cousteau and his young crew of divers and scientists explore little-known ocean territories, investigating undersea habitats, ecosystems, and an array of natural phenomena.
Join Jean-Michel Cousteau and the third generation of ocean explorers, his son Fabien and daughter Celine, as they investigate little known but breath-taking national marine sanctuaries throughout the United States. Traversing thousands of miles, Cousteau's team of expert divers take you below and above the sea off the coasts of Michigan, Texas, Florida, North Carolina, Georgia, Massachusetts, California, Oregon, Hawaii, and American Samoa in a quest to introduce you to these unique oceanic worlds.

A co-production of KQED Public Television and Jean-Michel Cousteau's Ocean Futures Society for PBS and Granada International

